wc.csv2table = function (parent, filename, cls) {
  wc.group("wc.csv2table");
  cls = cls || "";
  var str = "<table class=\"".concat(cls, "\"><thead><tr>");
  wc.getCSV(filename, function (data) {
    // THEAD
    for (var i = 0; i < data[0].length; i++) {
      str += "<th class=\"c-".concat(i, "\">").concat(data[0][i].replace(/ /g, ''), "</th>");
    }

    str += "</tr></thead><tbody>";
    var footer = "<tfoot><tr>";
    var once = false; // TBODY

    for (var i = 1; i < data.length; i++) {
      str += "<tr>";

      for (var j = 0; j < data[i].length; j++) {
        if (!once) {
          footer += "<td></td>";
        }

        str += "<td class=\"c-".concat(j, "\">").concat(data[i][j], "</td>");
      }

      str += "</tr>";
      once = true;
    }

    footer += "</tr></tfoot>";
    str += "<tbody>".concat(footer, "</table>");
    $(parent).append(str);
  });
  console.log(str);
  wc.groupEnd();
}; /////////////////////////////////////////////////////////////////////////////////
//// EXPORT TABLE TO csv
