  if ($("#" + ele + "-anchor").length == 0) {
    $("#" + ele).after("<div id=\"".concat(ele, "-anchor\" style=\"height:0\"></div>"));
  }

  $(window).scroll(function () {
    var scroll = $(window).scrollTop();
    var anchor_top = $("#" + ele).offset().top - offset;
    var anchor_bottom = $("#".concat(ele, "-anchor")).offset().top;

    if (scroll > anchor_top && scroll < anchor_bottom) {
      clone_table = $("#clone");

      if (clone_table.length == 0) {
        clone_table = $("#" + ele).clone();
        clone_table.attr('id', 'clone');
        clone_table.css({
          position: 'fixed',
          'pointer-events': 'none',
          top: offset + "px"
        });
        clone_table.width($("#" + ele).width());
        $("#table-container").append(clone_table);
        $("#clone").css({
          visibility: 'hidden'
        });
        $("#clone thead").css({
          visibility: 'visible'
        });
      }
    } else {
      $("#clone").remove();
    }

    wc.groupEnd();
  });
